function Contact() {
  return (
    <section data-aos="fade-up">
      <h2>Contact</h2>
      <p>Email: anjilamanandhar44@gmail.com</p>
      <p>Location: Banepa, Nepal</p>
      <p>
        <a href="https://www.linkedin.com/in/anjila-manandhar-8973201b7/" target="_blank" rel="noopener noreferrer">
          LinkedIn
        </a> | 
        <a href="https://gitlab.com/users/anjilamanandhar44/" target="_blank" rel="noopener noreferrer">
          GitLab
        </a>
      </p>
    </section>
  );
}

export default Contact;
